import React from 'react'
import {HeaderContainer, ImgContainer} from './styled'
import pokemonLogo from '../../assets'

const Header = () => {
    return(
        <HeaderContainer>
            <ImgContainer>
                <img src={pokemonLogo}/>
            </ImgContainer>
        </HeaderContainer>
    )
}
export default Header
